import React from "react";
import "./Provjere.css";
const Provjere = () => {
  return (
    <div>
      Provjere
      <ul id="kartica-provjere">
        <li className="provjera">
          <h2>Naziv</h2>
        </li>
        <li className="provjera">
          <h2>Trajanje: 10 min</h2>
        </li>
      </ul>
    </div>
  );
};

export default Provjere;
